// src/components/SelectExistingProject.js
import React from 'react';

const SelectExistingProject = () => {
    const projects = ['Project A', 'Project B', 'Project C']; // Replace with real data

    const handleSelectProject = (project) => {
        console.log('Selected project:', project);
        // Logic to join or navigate to the selected project
    };

    return (
        <div>
            <h2>Select Existing Project</h2>
            <ul>
                {projects.map((project) => (
                    <li key={project}>
                        <button onClick={() => handleSelectProject(project)}>
                            {project}
                        </button>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default SelectExistingProject;
